INSERT INTO `show` VALUES (1,'Očekujte neočekivano sa svim voljenim herojima okupljenim na novom zadatku.','Anthony Russo, Joe Russo',155,'Akcioni, Avantura, SF','Osvetnici: rat beskraja 3D',NULL ,'Robert Downey Jr, Benedict Cumberbatch',5,'MOVIE'),(2,'Ne bi li nekako sebi zabiberio život, a u potrazi za kondenzatorom fluksa, Vejd mora da se bori protiv nindži, jakuza i čopora seksualno agresivnih pasa, putujući po svetu i otkrivajući važnost porodice, prijatelja i ukusa.','David Leitch',119,'Akcioni, Komedija, Avantura','Deadpool 2',NULL,'Ryan Reynolds, Josh Brolin',4.5,'MOVIE'),(3,'U modernom hororu i trileru TIHO MESTO, četvoročlana porodica mora da vodi život u apsolutnoj tišini, nakon što njihov opstanak ugroze misteriozna bića koja love onog ko ispusti i najmanji zvuk. Ako te čuju, uloviće te!','John Krasinski',90,'Horor, Triler','Tiho mesto',NULL,'Emily Blunt, John Krasinski',5,'MOVIE'),(4,'Atari Kobajaši seda u svoj minijaturni turbo avion i leti do Ostrva đubreta, kako bi našao svog psa telohranitelja, Spota. Na tom ostrvu će uz pomoć novonastalih prijatelja započeti epsko putovanje koje će odlučiti o budućnosti čitave regije.','Wes Anderson',101,'Avantura, Animirani','Ostrvo pasa',NULL,NULL,4,'MOVIE'),(5,'Po motivima dela Ive Andrića.','Kokan Mladenović',100,'Drama, Istorijski','Na Drini Ćuprija',NULL,'Jelena Antonijević, Strahinja Bojović',5,'PLAY'),(6,'Po motivima dela Branislava Nušića.','Radoslav Milenković',90,'Komedija','Ujež',NULL,'Dragomir Pešić, Gordana Jošić Gajin',4,'PLAY'),(7,'Po motivima dela Jovana Sterije Popovića.','Radoje Čupić',90,'Komedija','Rodoljupci',NULL,'Milan Kovačević, Aleksandar Gajin',5,'PLAY');
